export const traderProfiles = {
  dayTrader: {
    layout: [
      { 
        i: 'chart', 
        x: 0, 
        y: 0, 
        w: 8,           // Width: 8 columns
        h: 8,           // Height: 8 rows
        minW: 4,        // Min width MUST be ≤ w (8)
        maxW: 12,       // Max width MUST be ≥ w (8)
        minH: 4,        // Min height MUST be ≤ h (8)
        maxH: 12        // Max height MUST be ≥ h (8)
      },
      { 
        i: 'orderbook', 
        x: 8, 
        y: 0, 
        w: 4,           // Width: 4 columns
        h: 8,           // Height: 8 rows
        minW: 2,        // Min width MUST be ≤ w (4)
        maxW: 6,        // Max width MUST be ≥ w (4)
        minH: 4,        // Min height MUST be ≤ h (8)
        maxH: 10        // Max height MUST be ≥ h (8)
      }
    ],
    widgets: [
      { i: 'chart', type: 'chart' },
      { i: 'orderbook', type: 'orderbook' }
    ]
  },
  investor: {
    layout: [
      { 
        i: 'chart', 
        x: 0, 
        y: 0, 
        w: 8, 
        h: 6,
        minW: 4,        // Fixed: minW ≤ w
        maxW: 12,       // Fixed: maxW ≥ w
        minH: 3,        // Fixed: minH ≤ h
        maxH: 10        // Fixed: maxH ≥ h
      },
      { 
        i: 'fundamentals', 
        x: 8, 
        y: 0, 
        w: 4, 
        h: 6,
        minW: 2,        // Fixed: minW ≤ w
        maxW: 6,        // Fixed: maxW ≥ w
        minH: 3,        // Fixed: minH ≤ h
        maxH: 8         // Fixed: maxH ≥ h
      }
    ],
    widgets: [
      { i: 'chart', type: 'chart' },
      { i: 'fundamentals', type: 'fundamentals' }
    ]
  }
};
